import { StyleSheet, Text, View, Image, TouchableOpacity } from "react-native";
import React from "react";

const FindPeople = () => {
  return (
    <View style={styles.boxContainer}>
      <View style={styles.box}>
        <Image
          source={require("../assets/img2.jpeg")}
          style={{ width: 110, height: 110, borderRadius: 100 }}
        />
        <View style={styles.boxBody}>
          <Text>UserName</Text>
          <Text>Name</Text>
          <TouchableOpacity style={styles.btn}>
            <Text>Follow</Text>
          </TouchableOpacity>
        </View>
      </View>
    </View>
  );
};

export default FindPeople;

const styles = StyleSheet.create({
  boxContainer: {
    width: "100%",
    // borderWidth: 1,
    // borderColor: "#000",
    marginTop: 50,
    marginLeft: 20,
  },
  box: {
    borderWidth: 1,
    borderColor: "#000",
    width: 150,
    height: 200,
    justifyContent: "center",
    alignItems: "center",
  },
  boxBody: {
    justifyContent: "center",
    alignItems: "center",
  },
  btn: {
    borderWidth: 1,
    borderColor: "#000",
    paddingVertical: 7,
    paddingHorizontal: 30,
    borderRadius: 5,
  },
});
